import React from 'react'
export default function FinishScreen({ points, maxPoints }) {
    const percentage = points / maxPoints * 100;

    return (
        <p>You scored <strong>{points}</strong> out of {maxPoints} ({percentage}.toFixed(2))</p>
    )
}
